import React from "react";

function calculateAge(): string {
    const now = new Date().getTime()
    const birthdate = new Date('2003-09-22').getTime()
    return (now - birthdate).toFixed(0).toString
}

export function LandingPage(): JSX.Element {
    return (<div className='flex grid grid-cols-2 gap-x-15 mx-auto'>
        <>Hi, I'm Nolan.</>
        <div className='bold'>I'm an {calculateAge()} aspiring Software Engineer.</div>
    </div>)
}
